import React from "react";

function Movie(props) {
    return 
    <div key={movie.id}>
        <img src={movie.medium_cover_image}></img>
        <h2>{movie.title}</h2>
        <p>{movie.summary}</p>
        <ul>
            {movie.genres.map(genre=><li>{genre}</li>)}
        </ul>
    </div>
}

export default Movie
